‚Å£
It's normal to worry, so don't feel bad if this is you, but these are a few things that you can probably cross off your plate. ‚Å£
‚Å£
1) Sneezing often‚Å£
‚Å£
Newborn's sneezing is simply how they clear their nasal and respiratory passages of congestion and airborne particles.‚Å£
‚Å£
2) Breast v Bottle ‚Å£
‚Å£
If you want to breastfeed, but are struggling it‚Äôs okay to pump and feed the baby through a bottle. Keep trying to breastfeed, but the mostt important thing is baby is getting fed.‚Å£
‚Å£
3) Hitting milestones / keeping up‚Å£
‚Å£
Your baby will walk, talk, and roll over at different times than someone else‚Äôs baby. There‚Äôs no need to compare or worry unless your Dr. expresses concerns.‚Å£
‚Å£
4) Pleasing Everyone‚Å£
‚Å£
The reality is that you‚Äôre not going to parent exactly like everyone wants to and everyone‚Äôs going to have their own opinion. Do what works for you.‚Å£
‚Å£
5) Being Perfect‚Å£
‚Å£
New Moms often worry that any mistakes made early will have lasting effects. We‚Äôre all figuring this out as we go and for the most part your baby will have no idea you‚Äôre winging it.‚Å£
‚Å£
